1. Suspensión y terminación del servicio del usuario

Si el usuario publica información ilegal, viola gravemente la moral social o viola las prohibiciones de la ley, el desarrollador deberá terminar la prestación de servicios al usuario;
Si el usuario comete un acto inapropiado al aceptar el servicio de software, el desarrollador tiene derecho a rescindir el servicio proporcionado al usuario (las circunstancias específicas del comportamiento inapropiado están claramente estipuladas en este acuerdo);
Si el usuario utiliza una versión modificada del software de un tercero, el usuario asumirá su propio riesgo y responsabilidad legal.

2. Suspensión, suspensión y terminación del Software y los Servicios：

En caso de que se produzca alguna de las siguientes circunstancias, el desarrollador tiene derecho a terminar o interrumpir la totalidad o parte de los servicios del software, y el desarrollador no será responsable ante el usuario o cualquier tercero por las molestias o daños causados por ello：

a. según lo requieran el Software y los Servicios;
b. Imposibilidad de funcionar correctamente debido a daños en el servidor;
c. Debido a una falla repentina de equipos de software y hardware y equipos de comunicación electrónica;
d. debido a fallas en la línea del proveedor de red u otras fallas;
e. debido a consideraciones de política;
f. Razones de terceros u otras circunstancias de fuerza mayor.

El Desarrollador se reserva el derecho de rescindir o rescindir parcialmente el Software y los Servicios cuando lo considere necesario, y el Desarrollador podrá notificar al Usuario en forma de anuncio, pero el Desarrollador no será responsable de las pérdidas causadas al Usuario.

Este Acuerdo se regirá por la ley de la República Popular China, sin tener en cuenta todas las disposiciones sobre conflicto de leyes;
El hecho de que el Desarrollador no ejerza, no ejerza de manera oportuna o ejerza plenamente los derechos disfrutados en virtud de este Acuerdo o de conformidad con la ley no se considerará una renuncia al ejercicio de dichos derechos, ni afectará el ejercicio de dichos derechos por parte del Desarrollador en el futuro;
